const Index = () => {
  return (
    <div className='notes-section'>
        <input type="text" className="input-title" placeholder='Title...' autoComplete='off'/>
        <hr />
        <textarea name="text-input-area" id="textarea-input" cols={3} rows={5}> 
        </textarea>
        <button type='button' className='delete-text'>Delete</button>
